import './Items.scss';
import axios from 'axios';
import Item from '../Item/Item';
export default function Items() {
  const fetchItems = () => {
    const items = axios.get('http://localhost:5000/get-items');
    console.log(items);
  };
  fetchItems();
  return (
    <div className="content">
      <Item />
      <Item />
      <Item />
      <Item />
      <Item />
    </div>
  );
}
